tables.table_schema:
CREATE TABLE website_traffic_data (
    website_id INT PRIMARY KEY,
    visitor_id INT,
    page_visited VARCHAR,
    visit_time TIMESTAMP
);

CREATE TABLE website_pages (
	page_id INT PRIMARY KEY,
	page_name VARCHAR(255),
	page_category VARCHAR(50),
	page_url VARCHAR(255)
);

CREATE TABLE dashboard_data (
	dashboard_id INT PRIMARY KEY,
	dashboard_name VARCHAR(255),
	dashboard_type ENUM('line_chart', 'bar_chart', 'pie_chart'),
	data_source_code TEXT
);
